import React from "react";
import { NavLink, Outlet } from "react-router-dom";
import background from "../Assets/background2.png";

export default function AdminPage() {
  return (
    <div className="flex flex-col min-h-screen bg-white text-gray-800 font-sans">
      <header className="relative bg-[#1e293b] text-white px-8 py-5 shadow-md flex justify-between items-center z-10">
        <h1 className="text-3xl font-semibold tracking-tight">Admin Panel</h1>

        {/* Decorative background */}
        <img
          //src={background}
          alt="Background Logo"
          className="absolute top-0 left-0 w-full h-full object-cover opacity-5 pointer-events-none select-none z-0"
        />

        <nav className="relative flex gap-8 text-base font-medium z-10">
          {["Employee", "Schedule", "CPA", "Tip"].map((tab) => (
            <NavLink
              key={tab}
              to={tab}
              className={({ isActive }) =>
                `pb-1 border-b-2 transition duration-200 ${
                  isActive
                    ? "border-white text-white"
                    : "border-transparent hover:border-gray-400 hover:text-gray-300"
                }`
              }
            >
              {tab}
            </NavLink>
          ))}
        </nav>
      </header>

      <main className="flex-1 p-8 bg-gray-50 overflow-auto relative z-10">
        <Outlet />
      </main>
    </div>
  );
}
